DROP TABLE IF EXISTS `%DB_PREFIX%record`;
CREATE TABLE `%DB_PREFIX%record` (
  `id` int(12) NOT NULL AUTO_INCREMENT,
  `real_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `address` text,
  `phone` varchar(20) DEFAULT NULL,
  `uid` bigint(20) DEFAULT '0' COMMENT '会员ID 对应%DB_PREFIX%web_user表主键',
  `ip` varchar(50) DEFAULT NULL COMMENT '用户IP',
  `status` int(1) DEFAULT '0' COMMENT '处理状态  0 未处理 1 已处理',
