DROP TABLE IF EXISTS `%DB_PREFIX%role`;
CREATE TABLE `%DB_PREFIX%role` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `pid` smallint(6) DEFAULT NULL,
  `status` tinyint(1) unsigned DEFAULT NULL,
  `remark` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`) USING BTREE,
  KEY `status` (`status`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `%DB_PREFIX%role_user`;
CREATE TABLE `%DB_PREFIX%role_user` (
  `role_id` mediumint(9) unsigned DEFAULT NULL,
  `user_id` char(32) DEFAULT NULL,
  KEY `group_id` (`role_id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `%DB_PREFIX%score_log`;
CREATE TABLE `%DB_PREFIX%score_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `from_uid` bigint(20) DEFAULT '0' COMMENT '来源用户ID（用于邀请注册）',
  `uid` bigint(20) DEFAULT NULL COMMENT '用户ID  对应%DB_PREFIX%web_user主键',
  `lid` bigint(20) DEFAULT NULL COMMENT '项目ID 对应%DB_PREFIX%loan表 主键',
  `invested_id` bigint(20) DEFAULT NULL COMMENT '投资ID 对应%DB_PREFIX%invested表主键',
  `score` double(20,0) NOT NULL COMMENT '交易积分',
  `type` int(1) DEFAULT NULL COMMENT '交易类型：1签到 2邀请注册 3认证操作 4投资  5系统操作 6积分兑换 7意见奖励',
  `pay_status` int(1) DEFAULT NULL COMMENT '收支状态  1收入 2支出',
